import React from "react";
import Header from "./components/Header"
import Footer from "./components/Footer"
import Items from "./components/items";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [
                {
                    id: 1,
                    title: 'Стул серый',
                    img: 'chair.jpg',
                    category: 'chairs',
                    desc: "Lorem Ipsum",
                    price: '49,99'
                },
                {
                    id: 2,
                    title: 'Стул',
                    img: 'chair2.jpg',
                    category: 'chairs',
                    desc: "Ipsum Lorem",
                    price: '59,99'
                },
                {
                    id: 3,
                    title: 'Стол',
                    img: 'chair2.jpg',
                    category: 'Tables',
                    desc: "Ipsum Lorem",
                    price: '39,99'
                }
            ]
        }
    }
    render() {
    return (
    <div className="wrapper">
      <Header/>
        <Items items={this.state.items}/>
      <Footer/>
    </div>
  );
    }
}

export default App;
